import { split as _split} from 'lodash';

class Store {
    id;
    contentsId;
    name;
    tel;
    address1;
    address2;
    availableTime;
    latitude;
    longitude;
    link;
    menu;

    constructor(data={}) {
        if (data == null) data = {};
        Object.assign(this, data)
    }
}

class Content {
    id;
    videoLinkId;
    channelId;
    storeId;
    title;
    tag;
    store;

    constructor(data={}) {
        if (data == null) data = {};
        Object.assign(this, data);
        this.store = new Store(data.store)
    }

    get tagList() {
        return _split(this.tag, "#").filter(s => s !== "").map(s => "#" + s);
    }
}

export default Content;
